import React, { useContext } from 'react'
import ContentContext from '../../../context/content-context'


const footerNav = (props) => {
  const content = useContext(ContentContext)

  return (

    <ul className="menu-items">
      {props.links.map(content => {
        return <li id="menu-item" className="menu-item-has-children"><a href="/" className="menu-item-title">{content.title}</a>
          {content.links.map(link => {
            return <ul className="sub-menu">
              <li id="menu-item-6" className="menu-item-nav-footer"><a href="/" className="footer-link">{link.name}</a></li>
            </ul>
          })
          }
        </li>
      }
      )
      }
    </ul>
  )
}
export default footerNav;
